(1614, 'Cliff: tweaked the purpose statement... THanks!!\n[AK: The following is feedback for the Purpose Statement:\n* This is a good purpose statement -- it is focused and understandable. \n* Can you be more clear on what "positive impact on society" means? That is, developing the quality of life of employees is already a societal good and if you qualify it with "positive impact on society" I am left wondering if there is a specific impact you have in mind. For example, does the development of quality of life mean that society can be more productive? That society will experience fulfillment? Something else?\n* What does "good ethical practices" mean? Is it integrity? Generosity? Equality? "Good ethical practices" is a little vague and a more concrete purpose statement is a stronger guiding principle, in the same way that you specifically called out "trust" as a guiding principle.]\n', 373, 25, 3840, '2013-08-07', 1, NULL, 1, 1, 3787, '2013-08-14 10:15:18'),
(1615, 'Establish an agenda for the meetings. Come up with examples on making them understand.', 374, 24, 3829, '2013-08-10', 1, ' In the "Purpose Statement", I recommend adding the "where"  of your purpose, (e.g. in Chennai, India, South India, etc.)  For action item 1, Does a dedicated team should be formed to work on purpose awareness within the company?  I think that should be your first action item (e.g. form tiger team to create awareness of the company''s purpose among all employees)', 1, 1, 2846, '2013-08-09 12:38:26'),
