(1631, 'Identify lands with lesser than the market price for developing immed', 383, 27, NULL, NULL, 1, ' [TS:  Purchasing property at below-market is a good goal, to the extent that it is an expression of good stewardship over the company''s financial resources.  How will you go about identifying properties to purchase at a low price?  (For example, is there something unique that you will be doing, which other construction companies will not be doing, to identify these properties?)  This will comprise the "Action" part of your Strategy.  Also, is there any way of blessing the sellers from whom you will be purchasing these properties at below market value?  For example, what if you were to purchase several properties at once from the same seller?  This could possibly allow you to obtain property at below market, and yet also bless the seller by minimizing the amount of administrative paperwork on their end.  Or could you somehow structure things so that the seller would receive their money more quickly?]', 10, 1, 52, '2013-08-11 18:16:35'),
