(1638, 'Create a database of clients', 391, 27, NULL, NULL, 1, ' [TS:  It''s possible that what you have put here would fit better under Presence.  And, from the set of Action Items you have listed, I think there could be enough there to generate multiple Strategies.  (For example, one Strategy related to creating a database of clients, one Strategy related to brand awareness, etc.)  Given limited resources, it will probably be important to figure out the most important component of the overall marketing strategy, and focus on that component first.]', 10, 1, 52, '2013-08-11 18:21:10'),
