(1847, 'Resume the practice of opening each day with prayer, enquiring of God to reveal His plans for the business.', 464, 24, NULL, NULL, 1, 'Good!  In your strategy it is important to define what is medium and lon-term goals since it can be different for different people.  For example, medium is 1-2 years and long term 3 to 5 years).  It is also recommended to redefine your strategy since having a planning process in place will not necessary assure you that you will make progress (e.g. the process may not be followed by your employees or you have resource issues that do not allow you to make progress).', 9, 1, 2846, '2013-08-15 00:20:36'),
(1848, 'Communicate purpose statement with employees', 373, 25, NULL, NULL, 1, NULL, 1, 3, 3787, '2013-08-14 10:21:52'),
(1849, 'Initiate monthly meetings with the managers.  At these meetings, discuss key strategies for the future, as well as status and plans of existing initiatives.', 464, 24, NULL, NULL, 1, 'This is good but I also recommend having  yearly planning meetings to formulate strategies for the year and ensure that your strategies are aligned with your mission, vision and purpose.  You also need to have another meeting to formulate long term strategies.  ', 9, 2, 2846, '2013-08-15 00:20:33'),
(1850, 'Implement quarterly meetings with all employees.  At these meetings, share performance results, as well as key upcoming activities for the company.', 464, 24, NULL, NULL, 1, 'Before communicating quarterly results, I recommend having quarterly reviews with key staff members to identify accomplisments, areas of opportunities and focus areas for the next quarter.  Once the information is analyzed and gathered, then you will be ready to  communicate the results  to the rest of the staff.  In that way you are acting in a more preventive mode rather than reactive.  It will also help you to maintain the focus  on what is needed to be where you want to be and mitigate any risks that can put you in a position of disadvantage in the marketplace.  ', 9, 3, 2846, '2013-08-15 00:06:26'),
