(77, 'Ensure that they are in a position that allows them to work out of their leadership type. ', 14),
(78, 'Set up regular (once a month) one-on-one meetings for employees with their managers or assigned mentor to allow them to air their concerns, but also to track personal plan progress. ', 14),
(79, 'Allow each employee to attend at least one training program a year that is in line with their personal goals and aligned with the goals of the company.', 14),
(80, 'Retake survey after 6 months.', 14),
(81, 'As discussion begins, employ a partnering readiness assessment to determine fit. Factors to consider include: company culture, values, are they of comparable size (speaking to the level of equality between the two of you), are the Company purposes compatible. ', 13),
(82, 'Outcome of the partnering assessment should determine if we partner, and when we do so, the level and depth of that partnership. ', 13),
(83, 'Should we decide to go forward, structure the deal such that it is mutually beneficial and generates profit for both companies. ', 13),
(84, 'Decide beforehand upon mediation process should there ever be disagreement ', 13),
(85, 'If possible trial the partnership on a joint venture before solidifying the partnership.', 13),
(86, 'Put infrastructure in place to measure the results of the partnership.', 13),
(87, 'Yearly revisions to ensure the Operating Manual remains current. ', 16),
(88, 'During the yearly revisions, Process improvements are explored and where necessary implemented. ', 16),
(89, 'Ensure that process improvement plans are on target. ', 16),
(90, 'Ensure all processes are aligned with kingdom principles', 16),
(91, 'Hold meeting with key leaders to discuss results and brainstorm how to further use hospitality to reinforce our purpose and values, and build rapport with the customer. ', 18),
(92, 'Implement the decisions made during the meeting. ', 18),
(93, '10-P Scorecard regularly updated and used to guide work ', 19);
