(182, 85, 6, 0, '[nj] do you see a change in the way they respect and speak to one another? are the listening more to each other? ', 1, '[TS] All these KPIs are good examples of taking an objective which is intangible (e.g., "people are invested in the group") and coming up with measurable ways of assessing whether that objective is being met.', 1, '2013-05-03 21:03:57'),
(183, 85, 6, 0, '[nj] can each member explain each other''s motivation with the project? ', 2, '[TS] It would probably be good to re-word all of these KPIs as statements rather than questions.  (E.g., "Each member can explain each other''s motivation with the project."  You may also want to include *how* that will be measured (e.g., by surveying the team each quarter).', 1, '2013-05-03 21:04:25'),
(184, 85, 6, 0, '[nj] is there an increase to those making their deadlines and being on time?', 3, '[TS] This is a good KPI for the second part of this Strategy''s objective, which is that people are operating in giving their best.', 1, '2013-05-03 21:04:36'),
(185, 87, 5, 0, 'Website traffic increase by 40%', 1, '[GS]Essentially a feedback loop to iteratively improves presence? Good, but I would suggest that these might actually be action items.\nAlso, remember that the KPI must measure the objective. The objective according to the strategy is increased identification of Kavod in the market. How do you measure that?', 1, '2013-04-04 04:32:00'),
(186, 87, 5, 0, 'Website sales improvement by 20-25% ', 2, '[GS]Since the KPI has to be measurable/quantifiable, might be better to explicitly state that over the period of time where the strategy is being implemented, you\\''re aiming for X% improvement in sales.', 1, '2013-04-04 04:32:01'),
(187, 90, 5, 0, 'Co-relate the product volumes sold/shipped with how the consumer found out about Kavod in order to measure which action item was the most successful in raising product awareness and thereby increasing sales.', 1, '', 1, '2013-04-04 04:21:12'),
(188, 92, 6, 4, 'Name recognition increase within next 6 months by 15% (number of hits on website, likes on facebook, etc.)', 1, '[TS] I like how, for all of these KPIs, you have taken an objective which is perhaps somewhat intangible and have come up with specific things you can measure!  For this one, you might want to go ahead and be real specific about what the metric will be -- e.g., \\"15% increase in number of hits on website in next 6 months.\\"', 50, '2013-05-04 00:01:25'),
