(218, 108, 6, 0, 'NJ : We are protected from any liablity for content use. (Consult with copyright attorney so that we''re legal to broadcast our content.)  Will this standup against a seize and desist order?', 1, '[TS] This seems like the start of a good KPI, having to do with the objective of ensuring that everything is being done legally.  So maybe it''s just a matter of re-stating what you''ve written -- maybe something like, "A copyright lawyer has confirmed that we are legal to broadcast our content and that the possibility of receiving a cease-and-desist order is remote."', 1, '2013-05-03 21:10:15'),
