(223, 110, 6, 0, 'Increased hits, linked to the promotion of their work in the I Am Amarai videos, on their personal/professional media websites', 1, '[TS] This is definitely measurable (good).  Is this truly a measure of the crew\\''s commitment to the project (which is the objective, right?)  If so, then it''s probably fine (though you might want to make it more specific, e.g., "20% increase in website hits over the next three months").  But if this is not actually a good measure of people''s commitment, perhaps you could come up with another KPI.  Or maybe you don''t even need this KPI # 1 because your KPI # 2 below, by itself, is a good enough measure of people\\''s commitment.', 1, '2013-05-03 21:06:52'),
(224, 110, 6, 0, 'Measured the team members'' overturn over a 6 months period.', 2, '[TS] I like this one because it really is a measure of people''s commitment to the project.  Could you re-state it as a measure?  E.g., something like, "Team member turnover is no more than 15% over a period of six months" ?', 1, '2013-05-03 21:07:17'),
