(109, 'Holistically assessing individual and corporate performance (360 analysis) allows us to champion professional success by offering tailored training that addresses near and long term goals.\n\nJM:  Our founding team''s persistent pursuit of personal enlightenment led us to fulfillment.  It''s a sincere joy to coach/navigate others to partake in the same.  Using a consultative approach, we leverage our scientifically-proven expertise in tailoring a unique, customized, scalable techniques to grow your talent pool.  As a trusted advisor, we leverage our proven HR strategies to meet your current and anticipated needs.\n\nCustomer-centric approach, "how can we help?" Our priority is serving your immediate needs and proactively serving your anticipated needs.  \n\nLeveraging a consultative approach we vet your needs, craft a customized solution and appoint a dedicated Servocraft advocate/trusted advisor to exceed your (for clients, candidates, and employees) expectations.\n', 83, 0, 4000, '2014-06-16 06:27:02'),
(110, 'To disciple working and studying women by providing a safe and homely place for them to stay, so that they feel like staying at home, experience the love of God, and feel the difference. ', 80, 1, 4118, '2014-06-16 09:49:28'),
