(112, ' We are a Christ-centered business providing highly customized, timely, cost-effective staffing and HR support services to customers in the manufacturing sector.  We are dedicated to mentoring candidates and clients for their personal & professional growth inturn contributing to societal transformation by tackling giants of unemployment and underemployment.  JM: we coach clients to invest in their ongoing education as it benefits them and their teams.  We invite our clients, candidates, staff and vendors to actively participate in our self-funded XYZ Foundation-- offering access to education in rural communities, so they can see the powerful impact of ongoing education.\n\nImproving employee/employer performance by offering end-to-end, customized Human Capital solutions and coaching clients and candidates to advance their own knowledge base and affording opportunities for them to mentor others.\n\nJM:  ', 83, 1, 4000, '2014-06-14 17:32:25'),
(113, 'To provide a safe and a homely place to stay for working and studying women in IT corridors, and to disciple them during their stay.', 80, 0, 4118, '2014-06-16 06:36:04'),
